type _IconValuesCoverDb =
  Exclude<DbPlatformIcon, PlatformIconKey> extends never
    ? true
    : { error: 'Database enum has values not in PLATFORM_ICON_VALUES' };
export type AssertPlatformIconValuesCoverDb = _IconValuesCoverDb;

